import React from 'react';
import Modal from '../Modal';


const StreamDelete = () => {
    const actions = (
        <React.Fragment>
            <div class="ui negative button">Delete</div>
            <div class="ui button">Cancel</div>
        </React.Fragment>
    );

    return (
        <div>
            StreamDelete
            <Modal 
                title="Delete Stream"
                content="Are you sure you want to delete this stream?"
                actions={actions}
            />
        </div>
    );
};

export default StreamDelete;
